import { useState } from "react";

const Card = () => {
  const [count, setCount] = useState(0);

  function handleAdd() {
    setCount(count+1);
  }
  function handleSubstract() {
    setCount (count--)
  }
    return (
        <div>
          <h1>React Counter App</h1>
          {count}
          <button className="--btn-primary" >- Substract</button>
          <button className="-btn-danger">!reset</button>
          <button className="--btn-success" onClick={handleAdd}>+ Add</button>        
        </div>

    )
    }

export default Card;
